import React, { Component } from 'react';
import './DisplaySubTask.css';

class DisplaySubTask extends Component {

constructor(props){
  super(props);

  this.createSubTasks = this.createSubTasks.bind(this);
}

  createSubTasks(item) {
    return <li className="li" key={item.key}>{item.name}</li>
  }

  render() {
    var todoEntries = this.props.entries;
    var subTasks = todoEntries.map(this.createSubTasks);

     return (
      <ul className="theList">
      {subTasks}
      </ul>
    );
  }
}

export default DisplaySubTask;
